                    開発過程においては、定期的に消防署職員に体験して頂き、適切なシナリオであるか、また、操作感が現実に近いかなどを伺って次の課題としていました。
                    シナリオは昼夜で合計最大6シナリオあり、夜間は見通しの悪さやライティングによるリアリティにおいて高評価を頂きました。
                    サイレンや無線音声は消防署にて録音させて頂いたものを使用するなど、数々の没入感に対する工夫を施しました。
